import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  /**
   * @description: 
   */
  private config = {
    signin : {
      redirectToPathname: '/dashboard/',
      eventAfterSignin: () => {
        this.router.navigate(['/dashboard/']);
      },
    }
  };

  /**
   * @description: 
   */
  constructor(
    private router: Router,
  ) { }


}
